webpackJsonp([0xaaddc181540f],{1155:function(t,a){t.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/fast-and-fresh-loading-graphics-with-ajaxloadinfo/index.md absPath of file >>> MarkdownRemark",html:'<p>Here\'s a neat little site - <a href="http://www.ajaxload.info/" title="Open link in a new window">ajaxload</a>.  There\'s nothing better than letting your user know when they\'re waiting for something, and although a simple animation can\'t tell them the exact progress, or how much longer they\'ll have to wait - it\'s often the thought that counts.  Your preloader / loading animation is that little extra bit of finessé for your creations.</p>\n<p>And ajaxload has a lovely little generator to knock some graphics up for you, in a variety of formats and completely customizable colours.</p>\n<p><img src="/content/images/2007/10/ajax-loader3.gif"> <img src="/content/images/2007/10/ajax-loader4.gif"> <img src="/content/images/2007/10/ajax-loader.gif"></p>',frontmatter:{title:"Fast and fresh loading graphics with ajaxload.info",date:"October 21, 2007",tags:["design","external-links"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/fish-eye-menu-in-actionscript-20/",tags:["flash","actionscript"],title:"Fish Eye Menu in ActionScript 2.0",image:null,date:"2008-10-12T13:01:05.000Z"}},next:{frontmatter:{path:"/blog/facebook-security/",tags:null,title:"Facebook security?!",image:null,date:"2008-05-30T21:10:51.000Z"}}}}}});
